def word_value(word):
    if not len(word) == len(mask[0]):
        print("bad parameters", len(word), len(mask[0]), word, mask[0])
        return
    restrictions = []
    value = 0
    for c in word:
        count = word.count(c)
        if (letters_in_the_bag[c] <= count):
            word = word.replace(c, "*", count - letters_in_the_bag[c])
            restrictions.append({"char": c, "max_achived": "bag {}  word {}".format(letters_in_the_bag[c], count)})

    for i in range(len(word)):
        value += letters_value_map[word[i]] * int(mask[0][i])
    return (value * mask[1], restrictions)


